import s from './style.module.css'

export function Test() {
	return (
		<div>
			<div className={s.app}>
				<header className={s.header}>Header</header>
				<div className={s.content}>
					<aside className={s.sidebar}>Sidebar</aside>
					<main className={s.main-content}>Main Content</main>
				</div>
			</div>
		</div>
	);
}
